import React from "react";
import "../../App.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";
import { Box, Container, Grid } from "@material-ui/core";
import f1 from "./SyImg/bizkimiz.jpg";
import f2 from "./SyImg/boru.jpg";
import f3 from "./SyImg/Hakkimizda.jpg";
import { sizing } from "@material-ui/system";

import ModalImage from "react-modal-image";

export default function Products() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
    Aos.refresh();
  }, []);
  return (
    <div>
      <div className="urunler"></div>
      <Container>
        <Grid container spacing={5} direction="row">
          <Grid item xs={12} md={6} xl={4} data-aos="fade-up" m={2}>
            <Box width="auto">
              <ModalImage small={f1} large={f1} hideDownload="true" />
            </Box>
          </Grid>
          <Grid item xs={12} md={6} xl={4} data-aos="fade-up">
            <div style={{ width: "350px", height: "350px" }}>
              <ModalImage small={f2} large={f2} hideDownload="true" />
            </div>
          </Grid>
          <Grid item xs={12} md={6} xl={4} data-aos="fade-up">
            <div style={{ width: "350px", height: "350px" }}>
              <ModalImage small={f3} large={f3} hideDownload="true" />
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
